(1, 'চানতারা গণ উচ্চ বিদ্যালয়', 'সু-শিক্ষাই জাতীর মেরুদন্ড', '১৯৭২ ', '১১৪১০৯', '', 'logo1.png', '', '01783558295', 'info@ctghs.edu.bd', 'ডাকঘরঃ চানতারা, উপজেলাঃ ঘাটাইল, জেলাঃ টাঙ্গাইল', 'http://www.ctghs.edu.bd', 'http://www.ctghs.com', 'সকাল ১০.০০ ঘটিকা হইতে ৪.০০ ঘটিকা', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d907.9143801432659!2d89.98364271126084!3d24.462664793550104!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39fdf52b27d2087b%3A0x36f9adaed1b3bccd!2zY2hhbnRhcmEgZ2FubyBoaWdoIHNjaG9vbCAoIOCmmuCmvuCmqOCmpOCmvuCmsOCmviDgppfgpqgg4KaJ4Kaa4KeN4KaaIOCmrOCmv-CmpuCnjeCmr-CmvuCmsuCnnyk!5e0!3m2!1sen!2sbd!4v1538201233530\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', 'টাঙ্গাইল জেলার ঘাটাইল উপজেলাধীন ৩নং জামুরিয়া মডেল ইউনিয়ন পরিষদেও অন্তর্গত ময়মনসিংহ টাঙ্গাইল মহাসড়কের গুণগ্রাম বাসষ্ট্যান্ড থেকে ১ কিলোমিটার পূর্ব দিকে চানতারা গ্রামে ১৯৭২ সালে চানতারা গণ উচ্চ বিদ্যালয়টি প্রতিষ্ঠিত হয়।', 'মোঃ শহিদুল ইসলাম,প্রধান শিক্ষক (ভারপ্রাপ্ত)', '০১৭৮৩৫৫৮২৯৫', 'chantaraganohighschool1972@gmail.com', '2_a_h_m1.jpg', 'Sign_11.jpg', 'আস্সালামু আলাইকুম। টাঙ্গাইল জেলার ঘাটাইল উপজেলাধীন জামুরিয়া মডেল ইউনিয়ন পরিষদের অন্তর্গত চানতারা গ্রামে ১৯৭২ সালে প্রতিষ্ঠিত হয় চানতারা গণ উচ্চ বিদ্যালয়। এলাকার গণ্যমান্য শিক্ষানুরাগী ও সর্ব সাধারণের ঐকান্তিক প্রচেষ্টায় গড়ে উঠে বিদ্যালয়টি। নিভৃত পল্লী এলাকায় অবস্থিত হলেও দক্ষ শিক্ষক মন্ডলী, ম্যানেজিং কমিটি, অভিভাবকগণের আন্তরিকতায় লেখাপড়ার পরিবেশ মানসম্মত। বর্তমান আধুনিক সভ্যতায় বিশ্বের সাথে প্রতিযোগীতায় টিকে থাকতে হলে শিক্ষার কোন বিকল্প নেই। বিজ্ঞান শিক্ষা ও তথ্য প্রযুক্তি বিষয়ে জ্ঞান অর্জন পূর্বক শিক্ষার্থীরা স্ব স্ব ক্ষেত্রে বাস্তবায়নে উৎসাহিত হয়ে এবং পরিবার, সমাজ ও জাতীয়ভাবে এর প্রতিফলন ঘটাবে। সর্বোপরি বিদ্যালয়ের উন্নয়ন ও সার্বিক সাফল্য কামনা করছি।', 'blankavatar.jpg', 'lightgreentheme', NULL, NULL, NULL);
