(8, 'খেলার মাঠ', 'playground', NULL, 58, 0, 'বিদ্যালয় সংলগ্ন পাকা দেয়াল বিশিষ্ট খেলার মাঠ আছে।  যে মাঠটিতে বর্তমানে বিদ্যালয়ে শিক্ষার্থীরা বিভিন্ন ধরণের খেলাধুলা করে থাকে। ', '2015-30-07', 0, 1, 1),
