(55, 'ইতিহাস', 'history', NULL, 1, 4, '১৯৭২ সালে এলাকার গন্যমান্য ব্যক্তি ও শিক্ষানুরাগীগণ সাধারণ মানুষের ছেলে মেয়েদেও শিক্ষত কওে গড়ে তোলার লক্ষ্যে প্রতিষ্ঠিত করেন বিদ্যালয়টি।  ০১-০১-১৯৭৪ সালে জুনিয়র হিসেবে এবং ০১-০১-১৯৯১ সাল থেকে মাধ্যমিক হিসেবে ১ম স্বীকৃতি লাভ করে যথারীতি পরিচালিত হয়ে আসছে। বিজ্ঞান, মানবিক ও ব্যবসায় শিক্ষা শাখা অনুমোদন আছে। বর্তমান স্বীকৃতির মেয়াদ উত্তীর্নেও তারিখ ৩১-১২-২০১৬। বর্তমানে প্রতিষ্ঠানটি অভিজ্ঞ শিক্ষক শিক্ষিকা দ্বারা সুনামের সাথে পরিচালিত হয়ে আসছে। বর্তমানে নিয়মিত পরিচালনা কমিটির বিভিন্ন কেটাগরির সদস্য দ্বারা সুষ্ঠভাবে উন্নয়নসহ অন্যান্য কার্যাদি সমাধান হয়ে আসছে।', '1450401420', 0, 1, 1),
