(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 21, 0, 'আস্সালামু আলাইকুম। টাঙ্গাইল জেলার ঘাটাইল উপজেলাধীন জামুরিয়া মডেল ইউনিয়ন পরিষদের অন্তর্গত চানতারা গ্রামে ১৯৭২ সালে প্রতিষ্ঠিত হয় চানতারা গণ উচ্চ বিদ্যালয়। এলাকার গণ্যমান্য শিক্ষানুরাগী ও সর্ব সাধারণের ঐকান্তিক প্রচেষ্টায় গড়ে উঠে বিদ্যালয়টি। নিভৃত পল্লী এলাকায় অবস্থিত হলেও দক্ষ শিক্ষক মন্ডলী, ম্যানেজিং কমিটি, অভিভাবকগণের আন্তরিকতায় লেখাপড়ার পরিবেশ মানসম্মত। বর্তমান আধুনিক সভ্যতায় বিশ্বের সাথে প্রতিযোগীতায় টিকে থাকতে হলে শিক্ষার কোন বিকল্প নেই। বিজ্ঞান শিক্ষা ও তথ্য প্রযুক্তি বিষয়ে জ্ঞান অর্জন পূর্বক শিক্ষার্থীরা স্ব স্ব ক্ষেত্রে বাস্তবায়নে উৎসাহিত হয়ে এবং পরিবার, সমাজ ও জাতীয়ভাবে এর প্রতিফলন ঘটাবে। সর্বোপরি বিদ্যালয়ের উন্নয়ন ও সার্বিক সাফল্য কামনা করছি।', '1450938847', 0, 1, 1),
